            if (isset($cosmetic['free'])) $free = $cosmetic['free'];
            if (isset($cosmetic['rarity'])) $rarity = $cosmetic['rarity'];

            if ($newCosmeticItem === null) {
                $newCosmeticItem = Cosmetic::create([
                    'id'   => $cosmetic['id'],
                    'type'   => $cosmetic['type'],
                    'sub_type'  => $cosmetic['sub_type'],
